import MainDescription from "./main_description";
import MainServices from "./main_services";
import MainContact from "./main_contact";

const Main = () => {
	return (
		<div>
			<div>
				<MainDescription></MainDescription>
				<MainServices></MainServices>
				<MainContact></MainContact>
			</div>
		</div>
	);
};

export default Main;
